overlay_info":null,"media_preview":"ACYqw9hThuo9CD+o4rSglnCDYF2jgE9T+vP1xRZ2ojTzJRluoXGfxI9T2BpiyMrGaUMBkBQewzUu9rlKzditdW7xLuf+I9vrVaOt2ZVnUoPmJHHOfp+Of0qmmmP0YgEegz/gKUXdDkrMqY7+tFXm0+RPu/MPXp+maKok0gp/hzx680SQngnnHX2oyQc1ZR93Bo3VgWjuV1XBzirLLlc1ERtJx2qwoIUZppaeom7srhgFy1FTOmOQM5opWGQmMN1oClakpwoAeVBGR160hJP1FSx1G/3vwprcT2GqSxx3Haik9+9FWSf/2Q==","owner":{"id":"1210123119","username":"aliceliveing"},"is_video":false,"accessibility_caption":"Photo shared by Alice - Live Workouts on March 31, 2021 tagging @lydiaxcollins. May be an image of 1 person and indoor.","edge_media_to_caption":{"edges":[{"node":{"text":"What\u2019s the WHY behind why you feel you can\u2019t take a day off from training? \u2063\n\u2063\nWhat makes you feel you have to push through? \u2063\n\u2063\nThe more I learn about exercise, the more I recognise the importance of rest. In today\u2019s podcast episode of Give Me Strength, we discuss why rest is so important to your workouts, not only for progression, but for your physical and mental health too.\u2063\n\u2063\nIf you\u2019re struggling to take rest days, ask yourself: \u2063\n\u2063\n1. Can I do something low impact/low intensity if I still feel I want to move? Choosing something like a long walk, gentle cycle or a stretch can be a great low intensity option if you still feel you want to move your body. \u2063\n\n2. Can I switch my mindset to see rest as helping me towards my goals, rather than hindering me? As we discuss tomorrow, the juicy progressions happen in the time spent out of the gym, so adopting this mindset can help to create a positive relationship with rest. \u2063\n\n3. Why can\u2019t I rest? For many people, exercise is intrinsically connected to calorie burn and fat loss goals. The mistake people make is thinking that the more they do, the quicker they\u2019ll achieve these goals. Unfortunately this just isn\u2019t the case. More doesn\u2019t always = better, and often it means increased stress on the body which can lead to a higher chance of injury, disruption to sleep, hormones and immune function. \u2063\n\u2063\nSo, please do tune in to today\u2019s podcast and start to think about your relationship to exercise and factoring in rest as and when you feel it\u2019s necessary. It\u2019s hard to suggest a binary number of days for rest, so I\u2019d say looking at your overall training volume, factoring how you feel within each session, and monitoring progression to see when it plateaus is more useful than me telling you what to do! \u2063\n\u2063\n\ud83d\udcaa\ud83c\udffb\ud83d\udc9c \u2063\n\u2063\n\u2063"}}]},"edge_media_to_comment":{"count":52},"comments_disabled":false,"taken_at_timestamp":1617196942,"edge_liked_by":{"count":2520},"edge_media_preview_like":{"count":2520},"location":null,"thumbnail_src":"https://instagram.feoh5-1.fna.fbcdn.net/v/t51.2885-15/sh0.08/e35/c0.82.1440.1440a/s640x640/167222000_283147620004515_2826765927741128520_n.jpg?tp=1\u0026_nc_ht=instagram.feoh5-1.fna.fbcdn.net\u0026_nc_cat=103\u0026_nc_ohc=U7QrU8AUeMkAX_5GQwR\u0026edm=ABfd0MgAAAAA\u0026ccb=7-4\u0026oh=56122c2b693d29e779a45091488263f3\u0026oe=60947D5B\u0026_nc_sid=7bff83","thumbnail_resources":[{"src":"https://instagram.feoh5-1.fna.fbcdn.net/v/t51.2885-15/e35/c0.82.1440.1440a/s150x150/167222000_283147620004515_2826765927741128520_n.jpg?tp=1\u0026_nc_ht=instagram.feoh5-1.fna.fbcdn.net\u0026_nc_cat=103\u0026_nc_ohc=U7QrU8AUeMkAX_5GQwR\u0026edm=ABfd0MgAAAAA\u0026ccb=7-4\u0026oh=f9ed7799cab3befa9ae302c311757be4\u0026oe=6092F2CE\u0026_nc_sid=7bff83","config_width":150,"config_height":150},{"src":"https://instagram.feoh5-1.fna.fbcdn.net/v/t51.2885-15/e35/c0.82.1440.1440a/s240x240/167222000_283147620004515_2826765927741128520_n.jpg?tp=1\u0026_nc_ht=instagram.feoh5-1.fna.fbcdn.net\u0026_nc_cat=103\u0026_nc_ohc=U7QrU8AUeMkAX_5GQwR\u0026edm=ABfd0MgAAAAA\u0026ccb=7-4\u0026oh=7850ba16d27ecc50149490ec7db1baf0\u0026oe=6095620C\u0026_nc_sid=7bff83","config_width":240,"config_height":240},{"src":"https://instagram.f violence meant that watching the new film TINA which is on Sky Documentaries felt really emotional and seeing her overcome abuse in the way she did makes me love her even more than I already did. Overcoming struggles and hardship to forge the career she has is a true inspiration to me, and an example of how abuse should never define a person.\u2063\n\u2063\nI have long been a HUGE Tina Turner fan, in fact I have known for forever that I want to dance to her songs at my wedding, but watching the documentary showed a side to her that I don\u2019t think has been explored before. During the film she draws back the curtain to invite us in to her private world in a way she has never done, revealing her inner most struggles and personal moments in a way that makes you feel you know her personally. I\u2019d love to hear if any of you have watched the documentary and your thoughts about it? \u2063\n\u2063\nDid you know as much about her as she shares, and what do you think of her now you\u2019ve watched it? #TinaFilm"}}]},"edge_media_to_comment":{"count":134},"comments_disabled":false,"taken_at_timestamp":1617039132,"edge_liked_by":{"count":9560},"edge_media_preview_like":{"count":9560},"location":null,"thumbnail_src":"https://instagram.feoh5-1.fna.fbcdn.net/v/t51.2885-15/sh0.08/e35/c0.180.1440.1440a/s640x640/165985347_487575069082380_8203627751397368521_n.jpg?tp=1\u0026_nc_ht=instagram.feoh5-1.fna.fbcdn.net\u0026_nc_cat=100\u0026_nc_ohc=SghfolsGNIgAX_nl09y\u0026edm=ABfd0MgAAAAA\u0026ccb=7-4\u0026oh=cf34785d7bd2c2ac229b8bdcd9e737ce\u0026oe=60922840\u0026_nc_sid=7bff83","thumbnail_resources":[{"src":"https://instagram.feoh5-1.fna.fbcdn.net/v/t51.2885-15/e35/c0.180.1440.1440a/s150x150/165985347_487575069082380_8203627751397368521_n.jpg?tp=1\u0026_nc_ht=instagram.feoh5-1.fna.fbcdn.net\u0026_nc_cat=100\u0026_nc_ohc=SghfolsGNIgAX_nl09y\u0026edm=ABfd0MgAAAAA\u0026ccb=7-4\u0026oh=a3f13dcb55d90c487e2feb3816f75f4d\u0026oe=60948950\u0026_nc_sid=7bff83","config_width":150,"config_heigh
